import React from "react";

export default function About() {
    return(
        <section id="about" className="text-white bg-black body-font">
            <div>
                <div>
                    <div class="text-9xl">
                        Alex
                    </div>
                    <div class="text-9xl">
                        Fox
                    </div>
                </div>
                <div>
                <blockquote class="imgur-embed-pub" lang="en" data-id="a/99KVf4q"  ><a href="//imgur.com/a/99KVf4q">me</a></blockquote><script async src="//s.imgur.com/min/embed.js" charset="utf-8"></script>
                </div>
            </div>
        </section>
    );
}
